import React, { useState } from 'react';

function FormulairePerformanceDurability() {
  const [expectedLifetime, setExpectedLifetime] = useState('');
  const [cycleLifeTest, setCycleLifeTest] = useState('');
  const [cRateTest, setCRateTest] = useState('');
  const [capacityThreshold, setCapacityThreshold] = useState('');
  const [soceThreshold, setSoceThreshold] = useState('');
  const [warrantyPeriod, setWarrantyPeriod] = useState('');
  const [puttingIntoServiceDate, setPuttingIntoServiceDate] = useState('');

  const [ratedCapacity, setRatedCapacity] = useState('');
  const [nominalVoltage, setNominalVoltage] = useState('');
  const [minimumVoltage, setMinimumVoltage] = useState('');
  const [maximumVoltage, setMaximumVoltage] = useState('');
  const [originalPowerCapability, setOriginalPowerCapability] = useState('');
  const [maxBatteryPower, setMaxBatteryPower] = useState('');

  const [idleStateLowerBoundary, setIdleStateLowerBoundary] = useState('');
  const [idleStateUpperBoundary, setIdleStateUpperBoundary] = useState('');

  const [initialInternalResistanceCell, setInitialInternalResistanceCell] = useState('');
  const [initialInternalResistancePack, setInitialInternalResistancePack] = useState('');

  const [initialSelfDischargeRate, setInitialSelfDischargeRate] = useState('');
  const [initialRoundTripEfficiency, setInitialRoundTripEfficiency] = useState('');
  const [roundTripEfficiency50Percent, setRoundTripEfficiency50Percent] = useState('');

  const [accidentInformation, setAccidentInformation] = useState('');
  const [deepDischargeEvents, setDeepDischargeEvents] = useState('');

  const handleExpectedLifetimeChange = (e) => {
    setExpectedLifetime(e.target.value);
  };

  const handleCycleLifeTestChange = (e) => {
    setCycleLifeTest(e.target.value);
  };

  const handleCRateTestChange = (e) => {
    setCRateTest(e.target.value);
  };

  const handleCapacityThresholdChange = (e) => {
    setCapacityThreshold(e.target.value);
  };

  const handleSoceThresholdChange = (e) => {
    setSoceThreshold(e.target.value);
  };

  const handleWarrantyPeriodChange = (e) => {
    setWarrantyPeriod(e.target.value);
  };

  const handlePuttingIntoServiceDateChange = (e) => {
    setPuttingIntoServiceDate(e.target.value);
  };

  const handleRatedCapacityChange = (e) => {
    setRatedCapacity(e.target.value);
  };

  const handleNominalVoltageChange = (e) => {
    setNominalVoltage(e.target.value);
  };

  const handleMinimumVoltageChange = (e) => {
    setMinimumVoltage(e.target.value);
  };

  const handleMaximumVoltageChange = (e) => {
    setMaximumVoltage(e.target.value);
  };

  const handleOriginalPowerCapabilityChange = (e) => {
    setOriginalPowerCapability(e.target.value);
  };

  const handleMaxBatteryPowerChange = (e) => {
    setMaxBatteryPower(e.target.value);
  };

  const handleIdleStateLowerBoundaryChange = (e) => {
    setIdleStateLowerBoundary(e.target.value);
  };

  const handleIdleStateUpperBoundaryChange = (e) => {
    setIdleStateUpperBoundary(e.target.value);
  };

  const handleInitialInternalResistanceCellChange = (e) => {
    setInitialInternalResistanceCell(e.target.value);
  };

  const handleInitialInternalResistancePackChange = (e) => {
    setInitialInternalResistancePack(e.target.value);
  };

  const handleInitialSelfDischargeRateChange = (e) => {
    setInitialSelfDischargeRate(e.target.value);
  };

  const handleInitialRoundTripEfficiencyChange = (e) => {
    setInitialRoundTripEfficiency(e.target.value);
  };

  const handleRoundTripEfficiency50PercentChange = (e) => {
    setRoundTripEfficiency50Percent(e.target.value);
  };

  const handleAccidentInformationChange = (e) => {
    setAccidentInformation(e.target.value);
  };

  const handleDeepDischargeEventsChange = (e) => {
    setDeepDischargeEvents(e.target.value);
  };

  return (
    <div className="flex flex-col items-center justify-center min-h-screen bg-gray-100">
      <div className="max-w-4xl w-full px-4 py-8">
        <h2 className="text-2xl font-bold mb-4 text-center">Performance and Durability</h2>

        {/* Sous-formulaire 1: Battery lifetime */}
        <h3 className="text-lg font-semibold mb-2">Battery lifetime</h3>
        <div className="mb-8 bg-gray-200 rounded-lg p-4">
          <div className="grid grid-cols-1 md:grid-cols-2 gap-x-4">
            <div className="flex flex-col space-y-2">
              <div className="flex items-center space-x-2">
                <label className="text-sm text-gray-700 w-full">Expected lifetime: Number of charge-discharge cycles</label>
                <input
                  type="text"
                  placeholder="Type here"
                  className="input input-bordered input-primary w-full max-w-xs"
                  value={expectedLifetime}
                  onChange={handleExpectedLifetimeChange}
                />
              </div>
              <div className="flex items-center space-x-2">
                <label className="text-sm text-gray-700 w-full">Cycle-life reference test</label>
                <input
                  type="text"
                  placeholder="Type here"
                  className="input input-bordered input-primary w-full max-w-xs"
                  value={cycleLifeTest}
                  onChange={handleCycleLifeTestChange}
                />
              </div>
              <div className="flex items-center space-x-2">
                <label className="text-sm text-gray-700 w-full">C-rate of relevant cycle-life test (A/Ah)</label>
                <input
                  type="text"
                  placeholder="Type here"
                  className="input input-bordered input-primary w-full max-w-xs"
                  value={cRateTest}
                  onChange={handleCRateTestChange}
                />
              </div>
              <div className="flex items-center space-x-2">
                <label className="text-sm text-gray-700 w-full">Capacity threshold for exhaustion (%)</label>
                <input
                  type="text"
                  placeholder="Type here"
                  className="input input-bordered input-primary w-full max-w-xs"
                  value={capacityThreshold}
                  onChange={handleCapacityThresholdChange}
                />
              </div>
              <div className="flex items-center space-x-2">
                <label className="text-sm text-gray-700 w-full">SOCE threshold for exhaustion (%)</label>
                <input
                  type="text"
                  placeholder="Type here"
                  className="input input-bordered input-primary w-full max-w-xs"
                  value={soceThreshold}
                  onChange={handleSoceThresholdChange}
                />
              </div>
              <div className="flex items-center space-x-2">
                <label className="text-sm text-gray-700 w-full">Warranty period of the battery (Years)</label>
                <input
                  type="text"
                  placeholder="Type here"
                  className="input input-bordered input-primary w-full max-w-xs"
                  value={warrantyPeriod}
                  onChange={handleWarrantyPeriodChange}
                />
              </div>
              <div className="flex items-center space-x-2">
                <label className="text-sm text-gray-700 w-full">Date of putting the battery into service</label>
                <input
                  type="text"
                  placeholder="Type here"
                  className="input input-bordered input-primary w-full max-w-xs"
                  value={puttingIntoServiceDate}
                  onChange={handlePuttingIntoServiceDateChange}
                />
              </div>
            </div>
          </div>
        </div>

        {/* Sous-formulaire 2: Capacity voltage & power capability */}
        <h3 className="text-lg font-semibold mb-2">Capacity voltage & power capability</h3>
        <div className="mb-8 bg-gray-200 rounded-lg p-4">
          <div className="grid grid-cols-1 md:grid-cols-2 gap-x-4">
            <div className="flex flex-col space-y-2">
              <div className="flex items-center space-x-2">
                <label className="text-sm text-gray-700 w-full">Rated capacity</label>
                <input
                  type="text"
                  placeholder="Type here"
                  className="input input-bordered input-primary w-full max-w-xs"
                  value={ratedCapacity}
                  onChange={handleRatedCapacityChange}
                />
              </div>
              <div className="flex items-center space-x-2">
                <label className="text-sm text-gray-700 w-full">Nominal voltage</label>
                <input
                  type="text"
                  placeholder="Type here"
                  className="input input-bordered input-primary w-full max-w-xs"
                  value={nominalVoltage}
                  onChange={handleNominalVoltageChange}
                />
              </div>
              <div className="flex items-center space-x-2">
                <label className="text-sm text-gray-700 w-full">Minimum voltage</label>
                <input
                  type="text"
                  placeholder="Type here"
                  className="input input-bordered input-primary w-full max-w-xs"
                  value={minimumVoltage}
                  onChange={handleMinimumVoltageChange}
                />
              </div>
              <div className="flex items-center space-x-2">
                <label className="text-sm text-gray-700 w-full">Maximum voltage</label>
                <input
                  type="text"
                  placeholder="Type here"
                  className="input input-bordered input-primary w-full max-w-xs"
                  value={maximumVoltage}
                  onChange={handleMaximumVoltageChange}
                />
              </div>
              <div className="flex items-center space-x-2">
                <label className="text-sm text-gray-700 w-full">Original power capability</label>
                <input
                  type="text"
                  placeholder="Type here"
                  className="input input-bordered input-primary w-full max-w-xs"
                  value={originalPowerCapability}
                  onChange={handleOriginalPowerCapabilityChange}
                />
              </div>
              <div className="flex items-center space-x-2">
                <label className="text-sm text-gray-700 w-full">Maximum permitted battery power</label>
                <input
                  type="text"
                  placeholder="Type here"
                  className="input input-bordered input-primary w-full max-w-xs"
                  value={maxBatteryPower}
                  onChange={handleMaxBatteryPowerChange}
                />
              </div>
            </div>
          </div>
        </div>

        {/* Sous-formulaire 3: Temperature conditions */}
        <h3 className="text-lg font-semibold mb-2">Temperature conditions</h3>
        <div className="mb-8 bg-gray-200 rounded-lg p-4">
          <div className="grid grid-cols-1 md:grid-cols-2 gap-x-4">
            <div className="flex flex-col space-y-2">
              <div className="flex items-center space-x-2">
                <label className="text-sm text-gray-700 w-full">Temperature range idle state (lower boundary)</label>
                <input
                  type="text"
                  placeholder="Type here"
                  className="input input-bordered input-primary w-full max-w-xs"
                  value={idleStateLowerBoundary}
                  onChange={handleIdleStateLowerBoundaryChange}
                />
              </div>
              <div className="flex items-center space-x-2">
                <label className="text-sm text-gray-700 w-full">Temperature range idle state (upper boundary)</label>
                <input
                  type="text"
                  placeholder="Type here"
                  className="input input-bordered input-primary w-full max-w-xs"
                  value={idleStateUpperBoundary}
                  onChange={handleIdleStateUpperBoundaryChange}
                />
              </div>
            </div>
          </div>
        </div>

        {/* Sous-formulaire 4: Internal resistance */}
        <h3 className="text-lg font-semibold mb-2">Internal resistance</h3>
        <div className="mb-8 bg-gray-200 rounded-lg p-4">
          <div className="grid grid-cols-1 md:grid-cols-2 gap-x-4">
            <div className="flex flex-col space-y-2">
              <div className="flex items-center space-x-2">
                <label className="text-sm text-gray-700 w-full">Initial internal resistance on battery cell level (Ohm)</label>
                <input
                  type="text"
                  placeholder="Type here"
                  className="input input-bordered input-primary w-full max-w-xs"
                  value={initialInternalResistanceCell}
                  onChange={handleInitialInternalResistanceCellChange}
                />
              </div>
              <div className="flex items-center space-x-2">
                <label className="text-sm text-gray-700 w-full">Initial internal resistance on battery pack level (Ohm)</label>
                <input
                  type="text"
                  placeholder="Type here"
                  className="input input-bordered input-primary w-full max-w-xs"
                  value={initialInternalResistancePack}
                  onChange={handleInitialInternalResistancePackChange}
                />
              </div>
            </div>
          </div>
        </div>

        {/* Sous-formulaire 5: Round trip energy efficiency & self-discharge */}
        <h3 className="text-lg font-semibold mb-2">Round trip energy efficiency & self-discharge</h3>
        <div className="mb-8 bg-gray-200 rounded-lg p-4">
          <div className="grid grid-cols-1 md:grid-cols-2 gap-x-4">
            <div className="flex flex-col space-y-2">
              <div className="flex items-center space-x-2">
                <label className="text-sm text-gray-700 w-full">Initial self-discharging rate (%)</label>
                <input
                  type="text"
                  placeholder="Type here"
                  className="input input-bordered input-primary w-full max-w-xs"
                  value={initialSelfDischargeRate}
                  onChange={handleInitialSelfDischargeRateChange}
                />
              </div>
              <div className="flex items-center space-x-2">
                <label className="text-sm text-gray-700 w-full">Initial round trip energy efficiency</label>
                <input
                  type="text"
                  placeholder="Type here"
                  className="input input-bordered input-primary w-full max-w-xs"
                  value={initialRoundTripEfficiency}
                  onChange={handleInitialRoundTripEfficiencyChange}
                />
              </div>
              <div className="flex items-center space-x-2">
                <label className="text-sm text-gray-700 w-full">Round trip energy efficiency at 50% of cycle life</label>
                <input
                  type="text"
                  placeholder="Type here"
                  className="input input-bordered input-primary w-full max-w-xs"
                  value={roundTripEfficiency50Percent}
                  onChange={handleRoundTripEfficiency50PercentChange}
                />
              </div>
            </div>
          </div>
        </div>

        {/* Sous-formulaire 6: Negative events */}
        <h3 className="text-lg font-semibold mb-2">Negative events</h3>
        <div className="mb-8 bg-gray-200 rounded-lg p-4">
          <div className="grid grid-cols-1 md:grid-cols-2 gap-x-4">
            <div className="flex flex-col space-y-2">
              <div className="flex items-center space-x-2">
                <label className="text-sm text-gray-700 w-full">Information on accidents</label>
                <input
                  type="text"
                  placeholder="Type here"
                  className="input input-bordered input-primary w-full max-w-xs"
                  value={accidentInformation}
                  onChange={handleAccidentInformationChange}
                />
              </div>
              <div className="flex items-center space-x-2">
                <label className="text-sm text-gray-700 w-full">Number of deep discharge events</label>
                <input
                  type="text"
                  placeholder="Type here"
                  className="input input-bordered input-primary w-full max-w-xs"
                  value={deepDischargeEvents}
                  onChange={handleDeepDischargeEventsChange}
                />
              </div>
            </div>
          </div>
        </div>

        {/* Bouton de soumission */}
        <div className="flex justify-end">
          <button
            type="submit"
            className="btn btn-primary py-2 px-6 rounded-md text-white bg-blue-500 hover:bg-blue-600 focus:outline-none focus:ring-2 focus:ring-blue-600 focus:ring-opacity-50"
          >
            Submit
          </button>
        </div>
      </div>
    </div>
  );
}

export default FormulairePerformanceDurability;
